import React, {Component}  from 'react';
import AppRoute from './AppRoute.js';
import Logo from './components/logo.js';


class App extends Component {
    render(){
      return(
        <div>
          <AppRoute/>
          <Logo/>

        </div>
      )
    }

  }


export default App;
